import "./App.css";
import Navbar from "./components/Navbar";
import Card from "./components/Card";

function App() {
  return (
    <>
      <Navbar />
      <div class="container text-center mt-5">
        <h1>Gallery</h1>
        <div class="row mt-5">
          {Array.apply(null, { length: 9 }).map(() => (
            <Card />
          ))}
        </div>
      </div>
    </>
  );
}

export default App;
